import React from "react";

import NamelistItem from "./NamelistItem";

function Namelist(){
    const name={
        name:{
            first:"Ahmed",
            last:"Anwer"
        },
        age:9
    }
    return(
        <div>
            <ul>
                <NamelistItem name={`${name.name.first} ${name.name.last} Hello`} age={name.age} />
                <NamelistItem name={`${name.name.first} ${name.name.last} `} age={name.age} />
                <NamelistItem name={`${name.name.first} ${name.name.last} `} age={name.age} />
                <NamelistItem name={`${name.name.first} ${name.name.last} `} age={name.age} />
            </ul>
        </div>
    );
}
export default Namelist;
